window.bookSummaryJSON = "<p>His name was Joshua Carter. Now it's whatever she wants it to be.</p> <p>She is a Deliverer. She lures young men and delivers them to be sold. She delivers the strikes that enforce their obedience. She delivers the training that determines their purchase price.</p> <p>As long as she delivers, the arrangement that protects her family will hold. Delivering is all she knows.</p> <p>The one thing she can't deliver is a captive from slavery.</p> <p>Until him.</p> <p>And her stubborn slave thinks he can deliver her...from herself.</p> <p><i>Note: HEA with no cliffhanger.</i></p>"; 
